# Checksums
# ---------
# Defines the SHA-256 checksums for all auto-downloaded gwen packages.
# Add checksum entries here for each package version that you want to enable
# auto-download for and that doesn't already contain an entry in this file.
# These checksums are used to verify the integrity of all downloads, to help
# prevent MITM attacks, and are necessary since all packages are downloaded
# from public web sites where the releases are published.
#
# You can calculate the checksum of a versioned package by running the
# following command on a known distribution:
#   (Linux, OSX, or Windows via Cygwin): shasum -a 256 known-dist.zip
# Then assign the printed checksum value to a property in this file like so:
#     gwen.checksum.package-version=checksum
#   Where:
#     package = gwen-web|selenium
#     version = the package version number
#     checksum = the sha-256 checksum value (hex digest)
#                Note: you can also provide a comma separated list of checksum
#                values for packages having cross platform distributions

